 SET NAMES utf8mb4 ;

CREATE DATABASE /*!32312 IF NOT EXISTS*/ `Mock_CP_Data` /*!40100 DEFAULT CHARACTER SET utf8 */;

USE `Mock_CP_Data`;

DROP TABLE IF EXISTS `Products`;

CREATE TABLE `Products` (
    `Product_ID` INT NOT NULL,
    `Product_Name` VARCHAR(255) CHARACTER SET utf8 NOT NULL,
    `Quantity` INT NOT NULL,
    `Price` NUMERIC(5, 2) NOT NULL,
	PRIMARY KEY (`Product_ID`)
);

LOCK TABLES `Products` WRITE;
UNLOCK TABLES;

DROP TABLE IF EXISTS `Branches`;

CREATE TABLE `Branches` (
    `Branch_ID` INT NOT NULL,
    `Branch_Name` VARCHAR(9) CHARACTER SET utf8 NOT NULL,
	PRIMARY KEY (`Branch_ID`)
);



LOCK TABLES `Branches` WRITE;
UNLOCK TABLES;

DROP TABLE IF EXISTS `Employees`;

CREATE TABLE `Employees` (
    `Employee_ID` INT NOT NULL,
    `Employee_Name` VARCHAR(255) CHARACTER SET utf8 NOT NULL,
    `Branch_ID` INT NOT NULL,
	PRIMARY KEY (`Employee_ID`),
	FOREIGN KEY (`Branch_ID`) REFERENCES `Branches` (`Branch_ID`)
);

LOCK TABLES `Employees` WRITE;
UNLOCK TABLES;

DROP TABLE IF EXISTS `Sales`;

CREATE TABLE `Sales` (
    `Sales_ID` INT NOT NULL,
    `Product_ID` INT NOT NULL,
    `Branch_ID` INT NOT NULL,
    `Employee_ID` INT NOT NULL,
    `Total_Sales` INT NOT NULL,
    `Sales_By_Branch` INT NOT NULL,
    `Sales_By_Employee` INT NOT NULL,
    `Total_Sales_Amount` NUMERIC(17, 13) NOT NULL,
	PRIMARY KEY (`Sales_ID`),
	FOREIGN KEY (`Product_ID`) REFERENCES `Products` (`Product_ID`),
	FOREIGN KEY (`Branch_ID`) REFERENCES `Branches` (`Branch_ID`),
	FOREIGN KEY (`Employee_ID`) REFERENCES `Employees` (`Employee_ID`)
);

LOCK TABLES `Sales` WRITE;
UNLOCK TABLES;

DROP TABLE IF EXISTS `Profits`;

CREATE TABLE `Profits` (
    `Product_ID` INT NOT NULL,
    `Branch_ID` INT NOT NULL,
    `Employee_ID` INT NOT NULL,
    `Total_Profit` NUMERIC(5, 2) NOT NULL,
    `Profit_By_Branch` NUMERIC(5, 2) NOT NULL,
    `Profit_By_Employee` NUMERIC(5, 2) NOT NULL,
	FOREIGN KEY (`Product_ID`) REFERENCES `Products` (`Product_ID`),
	FOREIGN KEY (`Branch_ID`) REFERENCES `Branches` (`Branch_ID`),
	FOREIGN KEY (`Employee_ID`) REFERENCES `Employees` (`Employee_ID`)
);
LOCK TABLES `Profits` WRITE;
UNLOCK TABLES;